import React, { Component } from 'react';

class Author extends Component {
    pickedAuthor = () => {
        let index = this.props.quotes.find(quote => {
            return quote;
        });
        console.log(index[0].quote);
    };
    render() {
        return (
            <div>
                <p>{this.pickedAuthor()}</p>
            </div>
        );
    }
}

export default Author;
